/*
 * Viewer 2.0.0 plugin
 */

class Viewer {
    constructor(containerId, options) {
        this.containerId = containerId;
        this.options = options;
        this.#init();
    }

//API
    loadBinaryModel(zipModelUrl) {
        this.manager.loadBinaryModel(zipModelUrl);
    }

    loadBase64Model(zipModelUrl) {
        this.manager.loadBase64Model(zipModelUrl);
    };

    preShowObject(objData) {
        this.manager.preShowObject(objData);
    }

    preHideObject(objData) {
        this.manager.preHideObject(objData);
    }

    recalculateModelTexture(objData, isObjectShow) {
        this.manager.recalculateModelTexture(objData, isObjectShow);
    }

    toggleWholeModel(visible) {
        this.manager.recalculateUVSForWholeModel(visible);
    }

    changeColorForSimpleShapes(simpleShapeId, colorHex) {
        this.manager.changeColorForSimpleShapes(simpleShapeId, colorHex);
    }

    changeTextForSimpleShapes(simpleShapeId, text) {
        this.manager.changeTextForSimpleShapes(simpleShapeId, text);
    }

    toggleSimpleShapesText() {
        this.manager.toggleSimpleShapesText();
    }

    removeSelectedResults() {
        this.manager.removeResults();
    }

    printScreen(toFileName) {
        this.manager.printScreen(toFileName);
    }

    toggleIsolines(flag) {
        this.manager.toggleIsolines(flag);
    }

    saveModelPosition() {
        this.manager.saveModelPosition();
    }

    removeModel() {
        this.manager.removeModel();
    }

    setResultDigits(resultDigits) {
        this.manager.setResultDigits(resultDigits);
    }

    setSearchNearestPointMode(mode) {
        this.manager.setSearchNearestPointMode(mode);
    }

    toggleMinMaxResults(flag) {
        this.manager.toggleMinMaxResults(flag);
    }

    setMinMaxUserInput(min, max) {
        this.manager.setMinMaxUserInput(min, max);
    }

    setTexture(textureName) {
        this.manager.setTexture(textureName);
    }


    #init() {
        const scope = this;
        window.URL = window.URL || window.webkitURL;
        window.BlobBuilder = window.BlobBuilder || window.WebKitBlobBuilder || window.MozBlobBuilder;
        scope.eventBus = new EventBus();
        scope.manager = new ViewerTHREEManager(scope.options, scope.eventBus);

        if (scope.options.type === 'viewer') {
            scope.viewport = new THREEWebGLViewer(scope.options, scope.eventBus);
        } else if (scope.options.type === 'editor') {
            scope.viewport = new THREEWebGLEditor(scope.options, scope.eventBus);
        }

        scope.viewport.container.setTop('0px');
        scope.viewport.container.setLeft('0px');
        scope.viewport.container.setRight('0px');
        scope.viewport.container.setBottom('0px');
        scope.viewport.axisViewer.container.setLeft('-30px');
        scope.viewport.axisViewer.container.setBottom('0px');
        scope.viewport.scaleViewer.container.setLeft('-115px');
        scope.viewport.scaleViewer.container.setTop('60px');
        const containerElement = document.getElementById(this.containerId);
        containerElement.append(scope.viewport.container.dom);
        containerElement.append(scope.viewport.axisViewer.container.dom);
        containerElement.append(scope.viewport.scaleViewer.container.dom);
        scope.#onWindowResize();
        scope.#initListeners();
    }

    #onWindowResize() {
        const scope = this;
        scope.eventBus.emit('window-resize');
    };

    #initListeners() {
        const scope = this;
        scope.eventBus.on('render-start', function () {
            if (scope.options.onStartRender) {
                scope.options.onStartRender();
            }

        });

        scope.eventBus.on('on-tree-load', function () {
            if (scope.options.onTreeLoad) {
                scope.options.onTreeLoad(this);
            }

        });

        scope.eventBus.on('on-find-nearest-object', function () {
            if (scope.options.onFindNearestObject) {
                scope.options.onFindNearestObject(this);
            }

        });

        scope.eventBus.on('on-print-screen-done', function () {
            if (scope.options.onPrintScreenDone) {
                scope.options.onPrintScreenDone(this.urlRenderer, this.printScreenMetadata);
            }

        });

        scope.eventBus.on('on-zip-update-status', function () {
            if (scope.options.onZipUpdateStatus) {
                scope.options.onZipUpdateStatus(this.status, this.percent);
            }

        });

        scope.eventBus.on('on-model-position-saved', function () {
            if (scope.options.onSaveModelPosition) {
                scope.options.onSaveModelPosition(this.position, this.fov);
            }
        });

        scope.eventBus.on('select-simple-shape', function () {
            if (scope.options.onSelectSimpleShape) {
                scope.options.onSelectSimpleShape(this);
            }
        });

        scope.eventBus.on('select-3d-point', function () {
            if (scope.options.onSelect3dPoint) {
                scope.options.onSelect3dPoint(this);
            }
        });

        window.addEventListener('resize', function () {
            scope.eventBus.emit('window-resize');
        }, false);
    };

}

export { Viewer as default };
